import React, { useState, useEffect } from "react";
import classes from "./SignupPage.module.css";
import { Link } from "react-router-dom";
import SignupFirst from "../../containers/SignupFirst/SignupFirst";
import SignupSecond from "../../containers/SignupSecond/SignupSecond";
import { useSelector } from "react-redux";

const SignupPage = (props) => {
  const { signupPage } = useSelector((state) => state);

  const [content, setContent] = useState(null);

  useEffect(() => {
    switch (signupPage) {
      case 1:
        setContent(<SignupFirst />);
        break;
      case 2:
        setContent(<SignupSecond />);
        break;

      default:
        break;
    }
  }, [signupPage]);

  return (
    <div className={classes.SignupPage}>
      <Link to="/" className={classes.backToHome}>
        <i className="fa fa-chevron-left"></i>
        <p>Back home</p>
      </Link>
      <div className={classes.loginContainer}>
        <div className={classes.leftSide}>{content}</div>
        <div className={classes.rightSide}>
          <img src="/images/bg.jpg" alt="img" />
          <div className={classes.overlay}></div>
        </div>
      </div>
    </div>
  );
};

export default SignupPage;
